randint = function(max) {
  return Math.floor(Math.random() * Math.floor(max));
};
randAlien = function(lien) {
  for (var i=0; i<lien; i++) {
    nx = (Math.random()-0.5) * game.options.map_size*10 ;
    ny = (Math.random()-0.5) * game.options.map_size*10 ;
    var x = randint(20);
    var mxlvl = 3;
    if (x > 10){
      switch(x){
        case 20:
          break;
        case 12:
          break;
        case 19:
          break;
        case 15:
          break;
        case 18:
          break;
        case 16:
          break;
        case 13:
          break;
        case 10:
          mxlvl = 2;
            game.addAlien({code:x,level:randint(mxlvl),x:nx,y:ny,crystal_drop:randint(300),weapon_drop:randsc()}) ;
          break;
        default:
            game.addAlien({code:x,level:randint(mxlvl),x:nx,y:ny,crystal_drop:randint(300),weapon_drop:randsc()}) ;
      }
    }
  }
} ;
randsecondary = function(lien) {
  for (var i=0; i<lien; i++) {
    nx = (Math.random()-0.5) * game.options.map_size*10 ;
    ny = (Math.random()-0.5) * game.options.map_size*10 ;
    var x = randint(21);
    var mxlvl = 3;
    if (x > 9){
      switch (x){
        case 10:
          game.addCollectible({code:x,x:ny,y:nx}) ;
          break;
        case 11:
          game.addCollectible({code:x,x:ny,y:nx}) ;
          break;
        case 12:
          game.addCollectible({code:x,x:ny,y:nx}) ;
          break;
        case 20:
          game.addCollectible({code:x,x:ny,y:nx}) ;
          break;
        case 21:
          game.addCollectible({code:x,x:ny,y:nx}) ;
          break;
        default:
          break;
      }
    }
  }
};
randsc = function() {
  while (true){
    nx = (Math.random()-0.5) * game.options.map_size*10 ;
    ny = (Math.random()-0.5) * game.options.map_size*10 ;
    var x = randint(21);
    var mxlvl = 3;
    if (x > 9){
      switch (x){
        case 10:
          return x;
        case 11:
          return x;
        case 12:
          return x;
        case 20:
          return x;
        case 21:
          return x;
        default:
          continue;
      }
    }
  }
};
